import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const UserProfileDialog = ({ isOpen, onClose, onLogout }) => {
  return isOpen ? (
    <div
      style={{
        position: "fixed",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        padding: "20px",
        background: "#ffffff",
        borderRadius: "10px",
        boxShadow: "0 0 10px rgba(0, 0, 0, 0.1)",
        zIndex: 999,
      }}
    >
      <button className="sign_out" style={{ float: "right" }} onClick={onClose}>
        Close
      </button>
      <div>
        <button className="sign_out" onClick={onLogout}>
          Log Out
        </button>
      </div>
    </div>
  ) : null;
};

const UserProfile = () => {
  let navigate = useNavigate();
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [initials, setInitials] = useState("");
  const [isDialogOpen, setDialogOpen] = useState(false);

  const openDialog = () => setDialogOpen(true);
  const closeDialog = () => setDialogOpen(false);

  useEffect(() => {
    const firstInitial = localStorage.getItem("firstName").charAt(0);
    const lastInitial = localStorage.getItem("lastName").charAt(0);
    setInitials(firstInitial + lastInitial);
  }, [firstName, lastName]);

  const handleLogout = () => {
    // Implement your logout logic here
    console.log("Logging out...");
    closeDialog(); // Close the dialog after logging out
    localStorage.removeItem("auth-token");
    localStorage.removeItem("firstName");
    localStorage.removeItem("lastName");

    navigate("/login");
  };

  return (
    <div style={{ position: "relative" }}>
      <div
        id="profileImage"
        style={{
          width: "50px",
          height: "50px",
          borderRadius: "50%",
          background: "antiquewhite",
          fontSize: "15px",
          color: "#3b3b3b",
          textAlign: "center",
          margin: "20px 0",
          lineHeight: "50px",
          cursor: "pointer",
          transition: "all 0.3s ease-in-out",
        }}
        onClick={openDialog}
      >
        {initials}
      </div>
      <UserProfileDialog
        isOpen={isDialogOpen}
        onClose={closeDialog}
